import React, { Component } from "react";
import "./general/general.css";
import imgTaibah from "../img/taibah universty logo.jpg";
import "../Homepage/BodyStyles.css";


class websiteFooter extends Component {

  render() {
    return (
        <div class="website-Footer" id="website-Footer">
    <div class="Footer-lift">
      <img src={imgTaibah} class="taibah-logo"/>
    </div>
    <div class="Footer-right">
      <p class="p-Footer-right">
        TTP@gmail.com : للتواصل معنا
      </p>
      <p class="p-Footer-right">
        © 2022 - طيبة للتدريب الميداني | جميع الحقوق محفوظة
      </p>
    </div>
  </div>
    );
  }
}

export default websiteFooter;
